import { Col, Layout, Button, Row, Menu } from 'antd';
import React from 'react';
import './Layout.css';
import { CgMenuLeftAlt } from 'react-icons/cg';
import { FiLogOut } from "react-icons/fi";
import { Link } from 'react-router-dom';

const { Header, Footer, Content, Sider } = Layout;

const Layouts = (props) => {
    return (
        <>
            <Layout className="layout-bg">

                <Header className='header'>
                    <Row>
                        <Col span={8}>
                            <Button className='menu-btn'><CgMenuLeftAlt /></Button> 
                        </Col>
                        <Col span={8} offset={8}> 
                            <Menu mode='horizontal' className='header-nav'>
                                <Menu.Item>logout <FiLogOut  /> </Menu.Item>
                            </Menu>
                        </Col>
                    </Row>
                </Header>

                <Content className="layout-bg">{props.children}</Content>


            </Layout>
        </>
    )
}
export default Layouts;
